import React from "react";
import { Link } from "react-router-dom";

const About = () => {
  return (
<section class="page-section bg-primary text-white mb-0" id="about">
            <div class="container">
                <h2 class="page-section-heading text-center text-uppercase text-white">About</h2>
                <div class="divider-custom divider-light">
                    <div class="divider-custom-line"></div>
                    <div class="divider-custom-icon"><i class="fas fa-star"></i></div>
                    <div class="divider-custom-line"></div>
                </div>
                <div class="row">
                    <div class="col-lg-4 ml-auto"><p class="lead">Maynooth University Women In STEM Society focuses on celebrating and empowering Women in Science, Technology, Engineering and Maths (STEM) related subjects in Maynooth University. We host and promote many events throughout the Semester such as panel discussions from companies, chill nights and more. We also have mentorship programs, career talks and many more opportunities for networking.</p></div>
                </div>
                <div class="text-center mt-4">
                    <a class="btn btn-xl btn-outline-light" href="https://startbootstrap.com/themes/freelancer/">
                        <i class="fas fa-download mr-2"></i>
                        Free Download!
                    </a>
                </div>
            </div>
        </section>
  );
};

export default About;
